            <Fade key={i} className={'animationContainer__item'} right> Right </Fade>
            <Fade key={i} className={'animationContainer__item'} bottom> Bottom </Fade>
            <Fade key={i} className={'animationContainer__item'} left> Left </Fade>
        </div>
    )
}

export default AnimationContainer
